import React, { Component } from "react";
import {
  Button,
  Col,
  Card,
  CardTitle,
  CardImg,
  Container,
} from 'reactstrap';

import "../App.css"

class SubscribeBox extends Component {
render() {
 return (
   <div className="box">
   <Container>
   <Col xs={12} sm={12} md={12} lg={12}>
      <Card outline color="info" body className="borderproduct">
        <CardTitle>Produk Kami</CardTitle>
        <CardImg width="70%" src={require(`../assets/menu1.png`)} alt="Card image cap" />
        <br/>
        <CardTitle>Daftar</CardTitle>
        <p>Kamu Tidak Perlu Repot Karena Kami Telah Memilih Snack Terbaik dan Akan Mengirimkan Langsung ke Kamu, Sehingga Kamu Bisa Fokuskan ke Hal Yang Lebih Penting</p>
        <Button
         href="/product"
         color="danger"
         size="lg"> Lihat Produk </Button>
      </Card>
   </Col>






   </Container>
   </div>
  )};
};

export default SubscribeBox;
